import React from "react";
import {Card, CardImg, CardBody,CardTitle} from 'reactstrap';

const MenuItem=(props)=>{
    const {name,image}= props.dish
    return(
       <Card>
           <CardBody>
               <CardImg src={image} width='100%'/>
           </CardBody>
       </Card>
    )
}
export default MenuItem
